static int hash_g(const char *key, const int *T)
{
    int sum = 0;

    for (int i = 0; key[i] != '\0'; i++)
    {
        sum += T[i] * key[i];
        sum %= 4631;
    }
    return G[sum];
}

static int perfect_hash(const char *key)
{
    if (strlen(key) > 35)
        return 0;

    return (hash_g(key, T1) + hash_g(key, T2)) % 4631;
}

